import React from "react";
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (

   <Router>

    <Navbar/>
    <Routes>
      <Route path="/">
        HOME
      </Route>

      <Route path="/note">
      Note
      </Route>

      <Route path="/create">
      Create Note
      </Route>
    </Routes>
   </Router>
  );
}

export default App;
